export class App extends Component {
    constructor(){
        super();
        this.state = {
            firstName:"",
            lastName: "",
        }
    }

    render() {
        return (
            <div>
                <form>
                   <input
                   name="firstName"
                   type="text"
                   onChange={this.handleChange}>
                   </input> 
                </form>
            </div>
        )
    }
}
export default App;
